// import './RightNav.css';

const RightNav = () => {
  return (
    <nav className="right-nav" id="right-nav">
      <ul className="nav-list">
        <li><a href="#Profile" className="nav-link"><i className="fa fa-address-card"></i>Profile</a></li>
        <li><a href="#Setting" className="nav-link"><i className="fa fa-cogs"></i>Setting</a></li>
        <li><a href="#About" className="nav-link"><i className="fa fa-info-circle"></i>About</a></li>
        <li><a href="#Contact" className="nav-link"><i className="fa fa-envelope"></i>Contact</a></li>
      </ul>
    </nav>
  );
};

export default RightNav;
